svg.script:
(function () {
	"use strict";

	function init(){
		var train = document.getElementById("train");
		var passengers = document.getElementsByClassName("passengers");
		var trainDoors = document.getElementsByClassName("train-doors");
		var tl1 = new TimelineMax({repeat:-1});

		tl1.from(train, 2, {x:-915, y:520, ease:Power1.easeOut});

		tl1.to(trainDoors, 1, {skewY:90, scaleX:0});

		tl1.staggerFrom(passengers, 1, {autoAlpha:0}, .2, 'boardTrain-=1.5');

		tl1.addLabel('boardTrain');

		tl1.staggerTo(Array().concat(passengers[1], passengers[0]), 2, {x:1070, y:1150}, .5, 'boardTrain');
		tl1.staggerTo(Array().concat(passengers[1], passengers[0]), 1, {autoAlpha:0}, .5, 'boardTrain+=1');

		tl1.staggerTo(Array().concat(passengers[3], passengers[2]), 2, {x:1330, y:990}, .5, 'boardTrain');
		tl1.staggerTo(Array().concat(passengers[3], passengers[2]), 1, {autoAlpha:0}, .5, 'boardTrain+=1');

		tl1.staggerTo(Array().concat(passengers[5], passengers[4]), 2, {x:1380, y:960}, .5, 'boardTrain');
		tl1.staggerTo(Array().concat(passengers[5], passengers[4]), 1, {autoAlpha:0}, .5, 'boardTrain+=1');

		tl1.to(trainDoors, 1, {skewY:1, scaleX:1}, 'boardTrain+=2');

		tl1.to(train, 2, {x:890, y:-500, ease:Power2.easeIn, delay:.1});
		tl1.to({}, 1, {});
	}

	window.addEventListener('load', init);
}());
